import React from 'react'
import Menu from '../Menu/index'
import './header.css'
import Logo from '../Logo'
import opcoes from '../Opcoes'

function Header(){
    return (
        <div className="container">
            <Logo />
            <Menu />
            <Opcoes />
        </div>
    );
}
export default Header;
